    struct WalletAttributes {
        bool isExchangePair;
        bool isTreasuryHolder;
    }
    mapping(address => WalletAttributes) public walletFlags;
    mapping(address => mapping(address => uint256)) private _allowances;

    uint256 private constant GENESIS_SUPPLY = 100 * (1e6) * (1e18);
    uint256 public constant BASE_DIVISOR = 10000; // 100%
    uint256 public constant BUY_TAX_CEIL = 500; // 5%
    uint256 public constant SELL_TAX_CEIL = 500; // 5%
    uint256 public sellFeeRate = 2500; // 25%
    uint256 public buyFeeRate = 2500; // 25%

    uint256 public constant HOLDING_CAP = 2 * (1e6) * (1e18); // 2M
    uint256 public constant SELL_CAP = 5 * (1e5) * (1e18); // 0.5M
    uint256 public buyCap = 2 * (1e6) * (1e18); // 2M

    IDexRouter public immutable dexRouter;

    // mainnet
    IDexFactory DEX_FACTORY =
    IDexFactory(0x5C69bEe701ef814a2B6a3EDD4B1652CB9cc5aA6f); // DEX_FACTORY
    address DEX_ROUTER = 0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D; // uniswapRouter
    address WRAPPED_ETH = 0xC02aaA39b223FE8D0A0e5C4F27eAD9083C756Cc2; // wrapped ETH

    // Sepolia
    // IDexFactory constant DEX_FACTORY =
    //     IDexFactory(0xB7f907f7A9eBC822a80BD25E224be42Ce0A698A0); // DEX_FACTORY
    // address constant DEX_ROUTER = 0x425141165d3DE9FEC831896C016617a52363b687; // uniswapRouter
    // address constant WRAPPED_ETH = 0x7b79995e5f793A07Bc00c21412e50Ecae098E7f9; // wrapped ETH

    address public immutable liquidityPair; // liquidity pool address

    address payable public feeCollector;

    bool public launchFlag = false;
    bool private swapLock = false;
    bool private allowSwaps = false;

    /// @notice Emitted when a liquidity pool pair is updated.
    event ExchangePairFlagged(address indexed pair, bool enabled);

    /// @notice Emitted when an account is marked or unmarked as a liquidity holder (treasury, staking, etc).
    event TreasuryWalletFlagged(address indexed account, bool flag);

    event TaxAddressSet(address _feeWallet);
    event BuyFeePaid(address indexed from, address indexed to, uint256 amount);
    event SellFeePaid(address indexed from, address indexed to, uint256 amount);
    event SwapBackResult(uint256 amountIn, uint256 amountOut);
    event EnabledTrading(bool tradingActive);

    modifier lockTheSwap() {
        swapLock = true;
        _;
        swapLock = false;
    }

    constructor(
        address _feeWallet
    ) ERC20("KSCOPE", "$KSCO") Ownable(msg.sender) {
        liquidityPair = DEX_FACTORY.createPair(address(this), WRAPPED_ETH);
        IDexRouter _uniswapV2Router = IDexRouter(DEX_ROUTER);
        dexRouter = _uniswapV2Router;

        setLiquidityHolder(msg.sender, true);
        setLiquidityHolder(address(this), true);
        setLiquidityHolder(_feeWallet, true);
        setLiquidityHolder(DEX_ROUTER, true);
        setLiquidityHolder(liquidityPair, true);
        setLiquidityHolder(address(0x000000000000000000000000000000000000dEaD), true);

        setLpPair(liquidityPair, true);
        setTaxAddress(_feeWallet);

        _mint(msg.sender, GENESIS_SUPPLY);
    }

    receive() external payable {}

    function swapTokensForEth(uint256 tokenAmount) private lockTheSwap {
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = dexRouter.WRAPPED_ETH();
        _approve(address(this), address(dexRouter), tokenAmount);
        uint ethBalanceBeforeSwap = address(this).balance;
        // make the swap
        dexRouter.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0, // accept any amount of ETH
            path,
            address(this),
            block.timestamp
        );

        emit SwapBackResult(
            tokenAmount,
            address(this).balance - ethBalanceBeforeSwap
        );
    }

    function sendETHToFee(uint256 amount) private {
       feeCollector.transfer(amount);
    }

    // Setters with onlyOwner

    function toggleMaxSellNumerator() public onlyOwner {
        sellFeeRate = SELL_TAX_CEIL;
    }
    function toggleMaxBuyNumerator() public onlyOwner {
        buyFeeRate = BUY_TAX_CEIL;
    }

    function setLpPair(address pair, bool enabled) public onlyOwner {
        walletFlags[pair].isExchangePair = enabled;
        emit ExchangePairFlagged(pair, enabled);
    }

    function setLiquidityHolder(address account, bool flag) public onlyOwner {
        walletFlags[account].isTreasuryHolder = flag;
        emit TreasuryWalletFlagged(account, flag);
    }

    function setTaxAddress(address newTaxAddress) public onlyOwner {
        require(newTaxAddress != address(0), "Tax address cannot be zero");
        feeCollector = payable(newTaxAddress);
        setLiquidityHolder(newTaxAddress, true);
        emit TaxAddressSet(newTaxAddress);
    }

    // enable trading
    function enableTrading() external onlyOwner {
        launchFlag = true;
        allowSwaps = true;
        emit EnabledTrading(true);
    }

    function _hasLimits(
        WalletAttributes memory fromInfo,
        WalletAttributes memory toInfo
    ) internal pure returns (bool) {
        return (!fromInfo.isTreasuryHolder || !toInfo.isTreasuryHolder);
    }

    function _update(
        address from,
        address to,
        uint256 amount
    ) internal virtual override {
        WalletAttributes memory fromInfo = walletFlags[from];
        WalletAttributes memory toInfo = walletFlags[to];

        if (
            !_hasLimits(fromInfo, toInfo) ||
            (fromInfo.isExchangePair && toInfo.isExchangePair)
        ) {
            super._update(from, to, amount);
            return;
        }

        uint256 taxFee = 0;
        uint256 transferAmount = amount;

        if (fromInfo.isExchangePair) {
            require(launchFlag, "Trading is not enabled!");
            taxFee = (amount * buyFeeRate) / BASE_DIVISOR;
            transferAmount = amount - taxFee;
            require(
                transferAmount <= buyCap,
                "Transfer amount exceeds the max buy amount"
            );
            emit BuyFeePaid(from, feeCollector, taxFee);
        } else if (toInfo.isExchangePair) {
            require(launchFlag, "Trading is not enabled!");
            taxFee = (amount * sellFeeRate) / BASE_DIVISOR;
            transferAmount = amount - taxFee;
            require(
                transferAmount <= SELL_CAP,
                "Transfer amount exceeds the max sell amount"
            );
            emit SellFeePaid(from, feeCollector, taxFee);
        }

        // Transfer the net amount to the recipient
        super._update(from, to, transferAmount);

        // Transfer tax to fee collector
        if (taxFee > 0) {
            super._update(from, feeCollector, taxFee);
        }

        // check max holding amount
        if (!toInfo.isTreasuryHolder) {
            require(
                balanceOf(to) <= HOLDING_CAP,
                "Transfer amount exceeds the max holding amount"
            );
        }
    }

